import cover_image from '../assets/cover_image.jpg'

const Login = () => {
    return (
    <div className="w-full h-[50%] flex items-start"> {/* Atur tinggi sesuai kebutuhan */}
      {/* Container dengan gambar sebagai background */}
      <div 
        className='relative w-full h-full flex flex-col justify-center items-start'
        style={{
          backgroundImage: `url(${cover_image})`,  // Gambar sebagai background
          backgroundSize: 'cover',                 // Gambar memenuhi seluruh div
          backgroundPosition: 'center',            // Gambar di posisi tengah
          backgroundRepeat: 'no-repeat',           // Gambar tidak diulang
        }}
      >
        {/* Teks di atas background gambar */}
        <div className='relative z-10 ml-[10%]'>
          <h1 className='text-4xl text-white font-bold my-4'>Turn Your Ideas into Reality</h1>
          <p className='text-xl text-white font-normal'>Start for free and get attractive offers from the community</p>
        </div>
      </div>
    </div>
    )
}

export default Login;
